        <p className="breadcrumb"><code><NavLink exact activeClassName="active" style={{color: 'cyan'}} to="/">Articles</NavLink> &gt; Git-Pages</code></p>

        <p>How to host your React App on Git-Pages for Free </p>
      </header>
    </div>
  );
}
